import React from 'react'
import { IconProps } from '../../../types/Icons/types'
import BaseIcon from '../../components/BaseIcon'
import DEFAULT_ICON from '../../constant'

type IconVariant = 'primary'
type Props = Omit<IconProps, 'variant' | 'color' | 'inActive'> & {
	variant?: IconVariant
}

export const DragPhotoshopIcon = React.forwardRef<SVGSVGElement, Props>((props, forwardedRef) => {
	//props
	const { variant = 'primary', size = DEFAULT_ICON.SIZE, ...restProps } = props

	const iconSize = typeof size === 'number' ? `${size}px` : size

	// variants
	const primary = (
		<svg
			viewBox='0 0 32 32'
			fill='none'
			xmlns='http://www.w3.org/2000/svg'
			xmlnsXlink='http://www.w3.org/1999/xlink'
			style={{ width: iconSize }}
			ref={forwardedRef}
			{...restProps}
		>
			<rect width={32} height={32} rx={8} fill='url(#pattern0)' />
			<defs>
				<pattern id='pattern0' patternContentUnits='objectBoundingBox' width={1} height={1}>
					<use xlinkHref='#image0_4418_65209' transform='translate(-0.0129395) scale(0.000488281)' />
				</pattern>
				<image
					id='image0_4418_65209'
					width={2101}
					height={2048}
					xlinkHref='data:image/png;base64,'
				/>
			</defs>
		</svg>
	)
	return <BaseIcon variants={{ primary }} variant={variant} />
})
